import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Login from './component/login';
import Signup from './component/signup';


function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>

        <Route exact path='/login' element={<Login/>}/>
        <Route exact path='/log' element={<Signup/>}/>


        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
